    "Hydrogen-Rich, Multifunctional Polymeric Nanocomposites for Radiation Shielding
    Project",nt"tracking_summary": {ntt"total": 3,ntt"recent": 1nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2015-05-06T21:39:22.496094",nt"name":
    "hydrogen-rich-multifunctional-polymeric-nanocomposites-for-radiation-shielding-project",nt"isopen":
    true,nt"url": null,nt"notes": "NASA has identified the need for the development
    of lightweight structures technologies to support Lunar Lander and Lunar Habitats
    programs and for the transfer of relevant technology to Crew Exploration Vehicle
    and Crew Launch Vehicle programs.  NASA further calls for revolutionary advances
    in radiation shielding materials and structures technologies to protect humans from
    the hazards of space radiation during NASA missions.  To address this need and in
    response to NASA Subtopic X6.03, International Scientific Technologies, Inc. in
    conjunction with the College of William and Mary, proposes the development of hydrogen-rich
    monomers for high performance polymers, such as polyimides, and the incorporation
    of metallic nanoparticles to form nanocomposite materials having multifunctional
    properties.  The Phase I Technical Objectives include preparation of hydrogen-rich
    monomers, fabrication of polymeric nanocomposite films, and acquisition of test
    data to determine key parameters for optimal radiation-shielding materials.  The
    anticipated result of the Phase I and Phase II programs is the development of polymeric
    nanocomposite materials consisting of hydrogen-rich monomers and metallic nanoparticles.
     The nanocomposite materials have multifunctional properties of radiation shielding
    against galactic cosmic radiation, neutrons and electromagnetic radiation, structural
    integrity to permit use in flexible and rigid structures and habitats, and electrical
    conductivity for electrostatic control to be used in dust mitigation during lunar
    missions.",nt"license_title": "U.S. Government Work",nt"extras": [{ntt"key":
